// mainInterface.js

import React, { useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Button, ListGroup, ListGroupItem, Form, InputGroup, FormControl, Container, Row, Col } from "react-bootstrap";

function MainInterface() {
    const [text, setText] = useState("");

    return (
        <Container>
            <Row>
                {/* Left Panel */}
                <Col xs={3}>
                    <Button variant="primary">+ New Interview</Button>
                    <ListGroup>
                        <ListGroupItem>Interview 1</ListGroupItem>
                        <ListGroupItem>Interview 2</ListGroupItem>
                        {/* ... */}
                    </ListGroup>
                    <Button variant="secondary">My Profile</Button>
                </Col>

                {/* Right Panel */}
                <Col xs={9}>
                    <div className="chat-box">
                        {/* Insert your chat messages here */}
                    </div>
                    <InputGroup className="mt-3">
                        <FormControl
                            as="textarea"
                            placeholder="Type your message..."
                            value={text}
                            onChange={(e) => setText(e.target.value)}
                            rows={3}
                        />
                        <InputGroup.Append>
                            <Button variant="outline-primary">Send</Button>
                        </InputGroup.Append>
                    </InputGroup>
                </Col>
            </Row>
        </Container>
    );
}

export default MainInterface;
